Issue #335: Use $method for the generic test name;

as $method is no longer changed in the sub.
Slightly nicer formatting of the generic test name.

JasonLeyba: Every js_fragment will now have implicit targets defined to
compile optimized versions for specific browsers (:android; :chrome; :ie;
and :ios). I'm switching the chrome; android; and iphone drivers to use
the optimized versions. Since IE's atoms are defined in a generic location;
I'm leaving those set to the generic version.



git-svn-id: https://selenium.googlecode.com/svn/trunk@11670 07704840-8298-11de-bf8c-fd130f914ac9

#16 - method for processing request to homepage moved from HomeController to PostController;
implemented method in PostController for displaying posts by page;
HomeController.java deleted.

Change logic for deviceName matching

If deviceName is identical to emulator name then this emulator will be used;
otherwise will be chosen the first one emulator which name starts with given deviceName

Introduced the `PageStateContainer` and `PageState` objects and added documentation to some of the code in this file.  More in description

`PageStateContainer` holds `PageState` instances and makes them
accessible as attributes.

`PageState` objects can be used to check if the web page is in a
pre-defined state.  You can define this in the same JSON used for the
`Page` object.  Here is an updated JSON format.  Everything stays the
same except now you can add a dict of `states`.

{
  "login_root": "https://reddit.com";
  "elements": {
    "login_link": {
      "selector": "Log in or sign up";
      "lookup_method": "link_text"
    };
    "username_input": {
      "selector": "user_login";
      "lookup_method": "id"
    };
    "password_input": {
      "selector": "passwd_login";
      "lookup_method": "id"
    };
    "remember_me": {
      "selector": "rem_login";
      "lookup_method": "id"
    };
    "login_button": {
      "selector": "button";
      "lookup_method": "tag_name";
      "parent": {
        "selector": "login-form";
        "lookup_method": "id"
      }
    };
    "logout_link": {
      "selector": "logout";
      "lookup_method": "link_text"
    };
    "redditor_time": {
      "selector": "age";
      "lookup_method": "class_name"
    };
    "moderator_list": {
      "selector": "side-mod-list";
      "lookup_method": "id"
    };
    "user_profile_link": {
      "selector": "user";
      "lookup_method": "class_name"
    }
  };
  "states": {
    "login_form_displayed": {
      "displayed": [
        "username_input";
        "password_input"
      ]
    };
    "login_link_displayed": {
      "displayed": [
        "login_link"
      ]
    };
    "login_finished": {
      "appears": [
        "logout_link"
      ];
      "displayed": [
        "logout_link"
      ];
      "disappears": [
        "username_input"
      ]
    };
    "on_profile": {
      "appears": [
        "redditor_time";
        "moderator_list"
      ]
    }
  }
}

âappearsâ means the element appears in the DOM; âdisappearsâ means the
element no longer appears in the DOM; âdisplayedâ means the element is
actually displayed on the screen; and ânot_displayedâ means the element
is no longer displayed on the screen.

Remove change_readme from release script

Now that Clojars embedded version number is in the README;
I have removed the static version placed there by this script;
so this script should stop trying to update it.

